Several smaller changes occurred to rand distributions: The Uniform distribution now additionally supports the char type, so for example rng.gen_range('a'..='f') is now supported. UniformSampler::sample_single_inclusive was added. The Alphanumeric distribution now samples bytes instead of chars. This more closely reflects the internally used type, but old code likely has to be adapted to perform the conversion from u8 to char. For example, with Rand 0.7 you could write: # use rand_0_7::{distributions::Alphanumeric, Rng};
# let mut rng = rand_0_7::thread_rng();
let chars: String = std::iter::repeat(()) .map(|()| rng.sample(Alphanumeric)) .take(7) .collect(); With Rand 0.8, this is equivalent to the following: # extern crate rand;
# use rand::{distributions::Alphanumeric, Rng};
# fn main() {
# let mut rng = rand::thread_rng();
let chars: String = std::iter::repeat(()) .map(|()| rng.sample(Alphanumeric)) .map(char::from) .take(7) .collect();
println!("chars = \"{chars}\"");
# } The alternative implementation of WeightedIndex employing the alias method was moved from rand to rand_distr::weighted_alias::WeightedAliasIndex . The alias method is faster for large sizes, but it suffers from a slow initialization, making it less generally useful. In rand_distr v0.4, more changes occurred (since v0.2): rand_distr::weighted_alias::WeightedAliasIndex was added (moved from the rand crate) rand_distr::InverseGaussian and rand_distr::NormalInverseGaussian were added The Geometric and Hypergeometric distributions are now supported. A different algorithm is used for the Beta distribution, improving both performance and accuracy. This is a value-breaking change. The Normal and LogNormal distributions now support a from_mean_cv constructor method and from_zscore sampler method. rand_distr::Dirichlet now uses boxed slices internally instead of Vec. Therefore, the weights are taken as a slice instead of a Vec as input. For example, the following rand_distr 0.2 code # use rand_distr_0_2::Dirichlet;
Dirichlet::new(vec![1.0, 2.0, 3.0]).unwrap(); can be replaced with the following rand_distr 0.3 code: # use rand_distr::Dirichlet;
Dirichlet::new(&[1.0, 2.0, 3.0]).unwrap(); rand_distr::Poisson does no longer support sampling u64 values directly. Old code may have to be updated to perform the conversion from f64 explicitly. The custom Float trait in rand_distr was replaced with num_traits::Float. Any implementations of Float for user-defined types have to be migrated. Thanks to the math functions from num_traits::Float, rand_distr now supports no_std. Additionally, there were some minor improvements: The treatment of rounding errors and NaN was improved for the WeightedIndex distribution. The rand_distr::Exp distribution now supports the lambda = 0 parametrization.

