Quite obviously, another RNG may be used to fill a seed. We provide a convenience method for this: # extern crate rand;
use rand::prelude::*; fn main() { let mut rng = SmallRng::from_rng(thread_rng()).unwrap(); println!("{}", rng.gen_range(0..100));
} But, say you want to save a key and use it later. For that you need to be a little bit more explicit: # extern crate rand;
# extern crate rand_chacha;
use rand::prelude::*;
use rand_chacha::ChaCha8Rng; fn main() { let mut seed: <ChaCha8Rng as SeedableRng>::Seed = Default::default(); thread_rng().fill(&mut seed); let mut rng = ChaCha8Rng::from_seed(seed); println!("{}", rng.gen_range(0..100));
} Obligatory warning : a few simple PRNGs, notably XorShiftRng , behave badly when seeded from the same type of generator (in this case, Xorshift generates a clone). For cryptographic PRNGs this is not a problem; for others it is recommended to seed from a different type of generator. ChaCha8Rng is an excellent choice for a deterministic master generator (but for cryptographic uses, prefer the 12-round variant or higher).

