For some applications, especially simulations, all you want are a sequence of distinct, fixed random number seeds, e.g. 1, 2, 3, etc. SeedableRng::seed_from_u64 is designed exactly for this use-case. Internally, it uses a simple PRNG to fill the bits of the seed from the input number while providing good bit-avalanche (so that two similar numbers such as 0 and 1 translate to very different seeds and independent RNG sequences). # extern crate rand;
# extern crate rand_chacha;
use rand::prelude::*;
use rand_chacha::ChaCha8Rng; fn main() { let mut rng = ChaCha8Rng::seed_from_u64(2); println!("{}", rng.gen_range(0..100));
} Note that a number with 64-bits or less cannot be secure , so this should not be used for applications such as cryptography or gambling games.

