Say you let users enter a string to seed the random number generator. Ideally, all parts of the string should influence the generator and making only a small change to the string should result in a fully independent generator sequence. This can be achieved via use of a hash function to compress all input data down to a hash result, then using that result to seed a generator. The rand_seeder crate is designed for just this purpose. use rand::prelude::*;
use rand_seeder::{Seeder, SipHasher};
use rand_pcg::Pcg64; fn main() { // In one line: let mut rng: Pcg64 = Seeder::from("stripy zebra").make_rng(); println!("{}", rng.gen::<char>()); // If we want to be more explicit, first we create a SipRng: let hasher = SipHasher::from("a sailboat"); let mut hasher_rng = hasher.into_rng(); // (Note: hasher_rng is a full RNG and can be used directly.) // Now, we use hasher_rng to create a seed: let mut seed: <Pcg64 as SeedableRng>::Seed = Default::default(); hasher_rng.fill(&mut seed); // And create our RNG from that seed: let mut rng = Pcg64::from_seed(seed); println!("{}", rng.gen::<char>());
} Note that rand_seeder is not suitable for cryptographic usage. It is not a password hasher , for such applications a key-derivation function such as Argon2 must be used.

