We use Rayon's parallel iterators , using map_init to initialize an RNG in each worker thread. Note: this RNG may be re-used across multiple work units, which may be split between worker threads in non-deterministic fashion. use rand::distributions::{Distribution, Uniform};
use rayon::prelude::*; static SAMPLES: u64 = 1_000_000; fn main() { let range = Uniform::new(-1.0f64, 1.0); let in_circle = (0..SAMPLES) .into_par_iter() .map_init(|| rand::thread_rng(), |rng, _| { let a = range.sample(rng); let b = range.sample(rng); if a * a + b * b <= 1.0 { 1 } else { 0 } }) .reduce(|| 0usize, |a, b| a + b); // prints something close to 3.14159... println!( "π is approximately {}", 4. * (in_circle as f64) / (SAMPLES as f64) );
}

