We use approach (4) above to achieve a deterministic result: initialize all RNGs from a single seed, but using multiple streams. We use ChaCha8Rng::set_stream to achieve this. Note further that we manually batch multiple work-units according to BATCH_SIZE. This is important since the cost of initializing an RNG is large compared to the cost of our work unit (generating two random samples plus some trivial calculations). Manual batching could improve performance of the above non-deterministic simulation too. (Note: this example is https://github.com/rust-random/rand/blob/master/examples/rayon-monte-carlo.rs .) use rand::distributions::{Distribution, Uniform};
use rand_chacha::{rand_core::SeedableRng, ChaCha8Rng};
use rayon::prelude::*; static SEED: u64 = 0;
static BATCH_SIZE: u64 = 10_000;
static BATCHES: u64 = 1000; fn main() { let range = Uniform::new(-1.0f64, 1.0); let in_circle = (0..BATCHES) .into_par_iter() .map(|i| { let mut rng = ChaCha8Rng::seed_from_u64(SEED); rng.set_stream(i); let mut count = 0; for _ in 0..BATCH_SIZE { let a = range.sample(&mut rng); let b = range.sample(&mut rng); if a * a + b * b <= 1.0 { count += 1; } } count }) .reduce(|| 0usize, |a, b| a + b); // prints 3.1409052 (determinstic and reproducible result) println!( "π is approximately {}", 4. * (in_circle as f64) / ((BATCH_SIZE * BATCHES) as f64) );
}

