For convenience, all generators automatically implement the Rng trait, which provides short-cuts to a few ways of generating values. This has several convenience functions for producing uniformly distributed values: Rng::gen generates an unbiased (uniform) random value from a range appropriate for the type. For integers this is normally the full representable range (e.g. from 0u32 to std::u32::MAX), for floats this is between 0 and 1, and some other types are supported, including arrays and tuples. This method is a convenience wrapper around the Standard distribution, as documented in the next section . Rng::gen_range generates an unbiased random value in the given range Rng::fill and Rng::try_fill are optimised functions for filling any byte or integer slice with random values It also has convenience functions for producing non-uniform boolean values: Rng::gen_bool generates a boolean with the given probability Rng::gen_ratio also generates a boolean, where the probability is defined via a fraction Finally, it has a function to sample from arbitrary distributions: Rng::sample samples directly from some distribution Examples: # extern crate rand;
use rand::Rng;
# fn main() {
let mut rng = rand::thread_rng(); // an unbiased integer over the entire range:
let i: i32 = rng.gen();
println!("i = {i}"); // a uniformly distributed value between 0 and 1:
let x: f64 = rng.gen();
println!("x = {x}"); // simulate rolling a die:
println!("roll = {}", rng.gen_range(1..=6));
# } Additionally, the random function is a short-cut to Rng::gen on the thread_rng : # extern crate rand;
# use rand::Rng;
# fn main() {
println!("Tossing a coin...");
if rand::random() { println!("We got lucky!");
}
# }

