Notice from the above that rng.gen() yields a different distribution of values depending on the type: i32 values are sampled from i32::MIN ..= i32::MAX uniformly f32 values are sampled from 0.0 .. 1.0 uniformly This is the Standard distribution. [Distribution]s are the topic of the next chapter, but given the importance of the Standard distribution we introduce it here. As usual, standards are somewhat arbitrary, but chosen according to reasonable logic: Values are sampled uniformly: given any two sub-ranges of equal size, each has an equal chance of containing the next sampled value Usually, the whole range of the target type is used For f32 and f64 the range 0.0 .. 1.0 is used (exclusive of 1.0), for two reasons: (a) this is common practice for random-number generators and (b) because for many purposes having a uniform distribution of samples (along the Real number line) is important, and this is only possible for floating-point representations by restricting the range. Given that, we can implement the Standard distribution for our own types: # extern crate rand;
use rand::Rng;
use rand::distributions::{Distribution, Standard, Uniform};
use std::f64::consts::TAU; // = 2π /// Represents an angle, in radians
#[derive(Debug)]
pub struct Angle(f64);
impl Angle { pub fn from_degrees(degrees: f64) -> Self { Angle(degrees * (std::f64::consts::TAU / 360.0)) }
} impl Distribution<Angle> for Standard { fn sample<R: Rng + ?Sized>(&self, rng: &mut R) -> Angle { // It would be correct to write: // Angle(rng.gen::<f64>() * TAU) // However, the following is preferred: Angle(Uniform::new(0.0, TAU).sample(rng)) }
} fn main() { let mut rng = rand::thread_rng(); let angle: Angle = rng.gen(); println!("Random angle: {angle:?}");
}

