Lets go over the distributions by type: For bool, Standard samples each value with probability 50%. For Option<T>, the Standard distribution samples None with probability 50%, otherwise Some(value) is sampled, according to its type. For integers (u8 through to u128, usize, and i* variants), Standard samples from all possible values while Uniform samples from the parameterised range. For NonZeroU8 and other "non-zero" types, Standard samples uniformly from all non-zero values (rejection method). Wrapping<T> integer types are sampled as for the corresponding integer type by the Standard distribution. For floats (f32, f64), Standard samples from the half-open range [0, 1) with 24 or 53 bits of precision (for f32 and f64 respectively) OpenClosed01 samples from the half-open range (0, 1] with 24 or 53 bits of precision Open01 samples from the open range (0, 1) with 23 or 52 bits of precision Uniform samples from a given range with 23 or 52 bits of precision For the char type, the Standard distribution samples from all available Unicode code points, uniformly; many of these values may not be printable (depending on font support). The Alphanumeric samples from only a-z, A-Z and 0-9 uniformly. For tuples and arrays, each element is sampled as above, where supported. The Standard and Uniform distributions each support a selection of these types (up to 12-tuples and 32-element arrays). This includes the empty tuple () and array. When using rustc ≥ 1.51, enable the min_const_gen feature to support arrays larger than 32 elements. For SIMD types, each element is sampled as above, for Standard and Uniform (for the latter, low and high parameters are also SIMD types, effectively sampling from multiple ranges simultaneously). SIMD support requires using the simd_support feature flag and nightly rustc. For enums, you have to implement uniform sampling yourself. For example, you could use the following approach: # use rand::{Rng, distributions::{Distribution, Standard}};
pub enum Food { Burger, Pizza, Kebab,
} impl Distribution<Food> for Standard { fn sample<R: Rng + ?Sized>(&self, rng: &mut R) -> Food { let index: u8 = rng.gen_range(0..3); match index { 0 => Food::Burger, 1 => Food::Pizza, 2 => Food::Kebab, _ => unreachable!(), } }
}

